import React from "react";
import { BrowserRouter } from "react-router-dom";
import Login from "../components/Login";
import Signup from "../components/Signup";

const Home = () => {
	return (
		<div class="home">
			<BrowserRouter>
				<Switch>
					<Route
						exact
						path="/login"
						render={(props) => (
							<Login
								{...props}
								handleLogin={this.handleLogin}
								loggedInStatus={this.state.isLoggedIn}
							/>
						)}
					/>
					<Route
						exact
						path="/signup"
						render={(props) => (
							<Signup
								{...props}
								handleLogin={this.handleLogin}
								loggedInStatus={this.state.isLoggedIn}
							/>
						)}
					/>
				</Switch>
			</BrowserRouter>
		</div>
	);
};
export default Home;
